// src/profile.jsx
import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function Profile() {
  const navigate = useNavigate();
  const [prefs, setPrefs] = useState({
    domains: [],
    roles: [],
    experience: "",
    work_mode: "",
    locations: [],
    visa_sponsorship: "",
  });

  const token = localStorage.getItem("access_token");

  // Redirect if not logged in
  useEffect(() => {
    if (!token) navigate("/login");
  }, [token, navigate]);

  // Fetch user preferences on mount
  useEffect(() => {
    if (!token) return;
    fetch("http://localhost:8000/profile", {
      headers: { Authorization: `Bearer ${token}` },
    })
      .then((res) => res.json())
      .then((data) => {
        if (data.detail) {
          navigate("/login"); // invalid token
        } else {
          setPrefs({
            domains: data.domains || [],
            roles: data.roles || [],
            experience: data.experience || "",
            work_mode: data.work_mode || "",
            locations: data.locations || [],
            visa_sponsorship: data.visa_sponsorship || "",
          });
        }
      });
  }, [token, navigate]);

  const handleChange = (e) => {
    const { name, value, options } = e.target;
    if (options) {
      // multi-select
      const selected = Array.from(options)
        .filter((opt) => opt.selected)
        .map((opt) => opt.value);
      setPrefs({ ...prefs, [name]: selected });
    } else {
      setPrefs({ ...prefs, [name]: value });
    }
  };

  const handleSave = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch("http://localhost:8000/profile", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(prefs),
      });
      const data = await res.json();
      if (res.ok) alert("Preferences saved!");
      else alert(data.detail || "Failed to save preferences");
    } catch (err) {
      console.error(err);
      alert("Failed to save preferences");
    }
  };

  return (
    <div className="profile-container">
      <h2>Your Job Preferences</h2>
      <form onSubmit={handleSave}>
        <label>Domains:</label>
        <select
          name="domains"
          multiple
          value={prefs.domains}
          onChange={handleChange}
        >
          <option value="AI">AI</option>
          <option value="Data Science">Data Science</option>
          <option value="Web Dev">Web Development</option>
          <option value="Finance">Finance</option>
        </select>

        <label>Roles:</label>
        <select
          name="roles"
          multiple
          value={prefs.roles}
          onChange={handleChange}
        >
          <option value="Analyst">Analyst</option>
          <option value="Engineer">Engineer</option>
          <option value="Manager">Manager</option>
          <option value="Developer">Developer</option>
        </select>

        <label>Experience (years):</label>
        <input
          type="number"
          name="experience"
          value={prefs.experience}
          onChange={handleChange}
        />

        <label>Work Mode:</label>
        <select name="work_mode" value={prefs.work_mode} onChange={handleChange}>
          <option value="">Select</option>
          <option value="Remote">Remote</option>
          <option value="Onsite">Onsite</option>
          <option value="Hybrid">Hybrid</option>
        </select>

        <label>Locations:</label>
        <select
          name="locations"
          multiple
          value={prefs.locations}
          onChange={handleChange}
        >
          <option value="NY">New York</option>
          <option value="CA">California</option>
          <option value="TX">Texas</option>
          <option value="FL">Florida</option>
        </select>

        <label>Visa Sponsorship:</label>
        <select
          name="visa_sponsorship"
          value={prefs.visa_sponsorship}
          onChange={handleChange}
        >
          <option value="">Select</option>
          <option value="Yes">Yes</option>
          <option value="No">No</option>
          <option value="Yes in future">Yes in future</option>
        </select>

        <button type="submit">Save Preferences</button>
      </form>
    </div>
  );
}
